import * as React from 'react';
import Title from './components/title_bar';
import Navbar from './components/nav_bar';
import './pageOne.css';

export default function Home() {

  const [Lang,SetLang]=React.useState('EN')

  let LangEN,LangDE;

  if(Lang ==='EN'){
    LangEN = 'block'
    LangDE = 'none'
  } else if (Lang ==='DE'){
    LangDE = 'block'
    LangEN = 'none'
  }

  return(

  <div> 

    <Title/>

    <Navbar onUpdate={(value:string)=>SetLang(value)} pg="4px solid red"/>

    <div className = 'newsbox_a'>
      <p style={{display:LangEN}}>News & Updates</p>
      <p style={{display:LangDE}}>Nachrichten & Updates</p>
    </div>

    <div className = 'newsbox_b'>
      <p style={{display:LangEN}}>In the prevailing circumstances, no activities has been planned....</p>
      <p style={{display:LangDE}}>Unter den gegebenen Umständen sind keine Aktivitäten geplant ....</p>
    </div>

    <div className = 'photobox'>
      <p>Recent events</p>

    </div >

  </div>
  )
}
